INSERT INTO `judasejournal` VALUES (160,60,'','Bom dia meninos do TI!!!\r\nSeguinte, h bastante tempo venho notando o monitor deste note, que fica com manchas e vultos em vermelho. Hj pedi q alguem viesse aqui ver e o marlon da do TI veio e confirmou o que eu achava, que o note est com a placa de video comprometida.\r\nEm virtude da seriedade dos trabalhos neste note arquivados, gostaria que vocs fizessem um beck up desta mquina para no correr risco de perder arquivos.\r\nTambm, considerando que o cooler desta mquina tambm nao est fuincionando bem faz tempo, que ele esquenta demais. que ele no tem mais bateria e o problema da placa de vdeo, venho atravs do presente solicitar seja adquirida uma nova maquina portatil para mim.\r\nconsiderando-se que minha funo inclui viajes, nas quais preciso levar a maquina, gostaria que fosse adquirda maquina pequena.....\r\nContando com Vossa Colaborao e no aguardo de retorno, e tbem ciente de q vcs sabem dos problemas desta maquina, sendo que a mesma pode ser reaproveitada em outro local onde seu uso nao seja to imprescindvel, aguardo!!!!\r\nAtenciosamente\r\nDaniela\r\nJurdico','Aberto','Urgente',148,108,1,2007-03-20 09:44:12,'n','30-03-2007','2007-03-30','','2007-03-20','','n','',148,148,'n','n','n','',0);
